import React, {Component} from 'react'


class DogsList extends Component {

    render() {
        const listObj = this.props.list;
        console.log(listObj);
        let dogsArr = [];

        for(var key in listObj) {
            dogsArr.push(key);
        }
        const items = dogsArr.map((dog) => <li>{dog}</li>);

        return (
            <ol>
                {items}
            </ol>
        )
    }

}

export default DogsList;
